import logo from './logo.svg';
import './App.css';
import User from '/User.js';

function App() {
    const name = 'John Doe';
    const email = 'johndoe@example.com';
    const grade = 'A';
    const reaction = 'üëç';

    return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
          <User name={name} email={email} grade={grade} reaction={reaction} />
      </header>
    </div>
  );
}

export default App;
